class ProjectListExpenditureRequestModel {  int? manageProjectId;  String? receiptPaymentType;  String? createdAt;  ProjectListExpenditureRequestModel(      {this.manageProjectId, this.receiptPaymentType, this.createdAt});  ProjectListExpenditureRequestModel.fromJson(Map<String, dynamic> json) {    manageProjectId = json['manage_project_id'];    receiptPaymentType = json['receipt_payment_type'];    createdAt = json['created_at'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['manage_project_id'] = this.manageProjectId;    data['receipt_payment_type'] = this.receiptPaymentType;    data['created_at'] = this.createdAt;    return data;  }}